(77, 'Bonn\'s Flame Baked Gluten Free Cracker', 'Bonn\'s & Co have been crafting exquisite crackers since the early 1900s. \r\n\r\nFirst, we blend the finest ingredients with pure Yorkshire Water. Then we bake using traditional open flame ovens for a light, crisp texture and classic flame baked flavour. \r\n\r\nSavour each Bonn\'s & Co flame baked cracker individually or use to compliment your favourite dips and toppings. \r\n\r\nCase of 10 x 150 Packs. ', 529, , 'Unlisted', , , , NULL, NULL, NULL, NULL);
