(79, 'NEW Vintner\'s Choice Water Crackers', 'The perfect partner - Essential for Wine tasting and appreciation.\r\n\r\nWhether you are new to wine tasting, a connoisseur, or a sommelier, you\'ll be more able to distinguish between the notes and flavours of each chosen wine if you use a recommended palate cleanser. Bonn\'s water crackers are the perfect partner for wine tasting and appreciation.\r\n\r\nCrafted using only two simple ingredients, flour from the finest locally grown wheat and Yorkshire water, then baked in our uniquely developed traditional ovens.\r\n\r\nThe light, crisp texture and classic flame-baked flavour are the perfect accompaniment for wine tasting.\r\n\r\n\r\nCase Size 10 x 150g\r\n\r\nOur History of making fine foods in the heart of Yorkshire dates back well over 100 years.', 530, , 'Unlisted', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
